protected container getPaymSpecFieldsMetaData(str _formatID)
{
    container   paymSpecFieldsList;

    //Metadata column names of data elements
    //FormatGroup,FormatID,PaymentSpec,FormatFieldID,Description,FieldType,CodeID,DefaultValue,Required,FixedValue,FixedValueMask,TechNotes

    switch (_formatID)
    {
        case ('US-CHASE-XML'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML();
            break;

        case ('US-CHASE-XML-CA'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_CA();
            break;

        case ('US-CHASE-XML-NO'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_NO();
            break;

        case ('US-CHASE-XML-EMEA'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_EMEA();
            break;

        case ('US-CHASE-XML-UK'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_UK();
            break;

        case ('US-CHASE-XML-HK'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_HK();
            break;

        case ('US-CHASE-XML-NL'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_NL();
            break;

        case ('US-CHASE-XML-MY'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_MY();
            break;

        case ('US-CHASE-XML-SG'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_SG();
            break;

        case ('US-CHASE-XML-CN'):
            paymSpecFieldsList = this.getPaymSpecFieldsMetaData_US_CHASE_XML_CN();
            break;

    }

    return paymSpecFieldsList;

}

