/// <summary>
/// Updating the bank code lookpups from the W0X fields.
/// </summary>
protected void updateBankCodelookupValues()
{
    switch(gSKS_EFT_FileFormat.FormatId)
    {
        case('US-CHASE-XML'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('CustomerId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('XchgRateTp', gSKS_EFT_Bank.W02);
            }
            if(gSKS_EFT_Bank.W03)
            {
                this.updateBankFields('XchgRateCtrctId', gSKS_EFT_Bank.W03);
            }
            if(gSKS_EFT_Bank.W04)
            {
                this.updateBankFields('FrmsCd', gSKS_EFT_Bank.W04);
            }
            break;
        case('US-CHASE-XML-CA'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('CustomerId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W04)
            {
                this.updateBankFields('FrmsCd', gSKS_EFT_Bank.W04);
            }
            break;
        case('US-CHASE-XML-CH'):
        case('US-CHASE-XML-CZ'):
        case('US-CHASE-XML-DK'):
        case('US-CHASE-XML-EMEA'):
        case('US-CHASE-XML-HK'):
        case('US-CHASE-XML-HU'):
        case('US-CHASE-XML-MY'):
        case('US-CHASE-XML-NL'):
        case('US-CHASE-XML-NO'):
        case('US-CHASE-XML-PL'):
        case('US-CHASE-XML-SE'):
        case('US-CHASE-XML-SG'):
        case('US-CHASE-XML-UK'):
        case('US-CHASE-XML-ZA'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('CustomerId', gSKS_EFT_Bank.W01);
            }
            break;
        case('US-CHASE-XML-CN'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('CustomerId', gSKS_EFT_Bank.W01);
            }
            break;
     }
}

/// <summary>
/// Updating vendor code lookpus from BE0X and Legacy code loookups
/// </summary>
protected void updateVendorCodelookupValues()
{
    switch(gSKS_EFT_FileFormat.FormatId)
    {
        case 'US-CHASE-XML':
        case 'US-CHASE-XML-CA':
        case ('US-CHASE-XML-NO'):
        case ('US-CHASE-XML-EMEA'):
        case ('US-CHASE-XML-UK'):
            if(gSKS_EFT_VendorPaym.WBeneMailHandling)
            {
                this.updateVendorFields('RmtLctnMtd', gSKS_EFT_VendorPaym.WBeneMailHandling, true);
            }
            break;
    }
